  let timeLeft;
  let body = document.getElementsByTagName("BODY")[0];
  let resetLinkTimer;
  
  function timerTimeout() {
    document.getElementsByClassName('reset-link')[0].classList.remove('hide');
    document.getElementById("otp-timer").innerHTML = "";
    clearInterval(resetLinkTimer);
    timeLeft = 0;
  }
  
  function timerInterval() {
    const secs = Drupal.t('Seconds');
    if (timeLeft > 0) {
      document.getElementById("otp-timer").innerHTML = timeLeft + " " + secs;
      timeLeft -= 1;
    }
  }
  
  /**
   * OTP timer
   */
  Drupal.AjaxCommands.prototype.otpTimer = function () {
    let reset_link = document.getElementsByClassName('reset-link')[0];
    if (timeLeft > 0 && body.dataset.timerRunning) {
      if (!reset_link.classList.contains('hide')) {
        reset_link.classList.add('hide');
      }
    }
    if ('true' !== body.dataset.timerRunning) {
      reset_link.classList.add('hide');
      timeLeft = document.getElementsByName('code_exp')[0].value;
      timeLeft = (timeLeft) ? timeLeft : 90;
      body.dataset.timerRunning = true;
      setTimeout(timerTimeout, timeLeft * 1000);
      resetLinkTimer = setInterval(timerInterval, 1000);
    }
  };
